  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA CoastWatch distributes near real time
  Ekman current (in zonal, meridional, and modulus sets) and Ekman upwelling data.
  \ This data begins with wind velocity measurements from the ASCAT instrument onboard
  EUMETSAT's METOP satellite.  ASCAT is a microwave scatterometer designed to measure
  surface winds over the global ocean.  NOAA CoastWatch processes wind velocity to
  wind stress and wind stress curl, and finally to Ekman current and Ekman upwelling.\",\n\t\"license_title\":
